(103, '对话扣除', 1, '83', '提问【在uniapp中我在做一个消息页面】扣除一次', 56, 0, '56', '2023-04-15 17:27:46', '56', '2023-04-15 17:27:46', '1'),
(104, '对话扣除', 1, '83', '提问【但是遇到了一个问题,下面的代码是：监控输入法的：			// 如果需要缓存消息缓存msgList即可 			// 监听键盘拉起 			// 因为无法控制键盘拉起的速度,所以这里尽量以慢速处理 			uni.onKeyboardHeightChange(res => { 				const query = uni.createSelectorQuery() 				query.select(\'#okk\').boundingClientRect(data => { 					// 若消息体没有超过2倍的键盘则向下移动差值,防止遮住消息体 					var up = res.height * 2 - data.height - l * 110  					if (up > 0) { 						console.log(\"向下移动300\") 						// 动态改变空盒子高度 						this.msgMove(up, 300) 						// 记录改变的值,若不收回键盘且发送了消息用来防止消息过多被遮盖 						mgUpHeight = up  					} 					// 收回 					if (res.height == 0) { 						console.log(\"回归原位\") 						this.msgMove(0, 0) 					} 				}).exec(); 			}) 			var query = uni.getSystemInfoSync()  			l = query.screenWidth / 750 			wh = query.windowHeight 			this.srcollHeight = query.windowHeight + \"px\"】扣除一次', 56, 0, '56', '2023-04-15 17:28:23', '56', '2023-04-15 17:28:23', '1'),
(105, '对话扣除', 1, '83', '提问【msgMove(x, t) { 				var animation = uni.createAnimation({ 					duration: t, 					timingFunction: \'linear\', 				})  				this.animation = animation  				animation.height(x).step()  				this.anData = animation.export() 			},这是msgMove方法】扣除一次', 56, 0, '56', '2023-04-15 17:29:04', '56', '2023-04-15 17:29:04', '1'),
(106, '对话扣除', 1, '83', '提问【我按照这个来监听消息体的移动,但是当我点击对话时,消息体总是偏下面一点点，帮我看看啥问题】扣除一次', 56, 0, '56', '2023-04-15 17:30:29', '56', '2023-04-15 17:30:29', '1'),
(107, '对话扣除', 1, '83', '提问【但是msgMove(x, t)中X就是y的位置啊】扣除一次', 56, 0, '56', '2023-04-15 17:33:44', '56', '2023-04-15 17:33:44', '1'),
